import Header from "./components/Layout/Header";
import React, { useState, Fragment } from "react";

function App() {
  const dummyData = [
    {
      id: 1,
      percent: 40,
    },
    {
      id: 2,
      percent: 60,
    },
  ];

  function weightRandom(itemWeight) {
    const totalWeight = eval(itemWeight.join("+"));
    return totalWeight;
  }

  return (
    <React.Fragment>
      <Header />
      <button>Click Me!</button>
      <p>{weightRandom(dummyData.percent)}</p>
    </React.Fragment>
  );
}

export default App;
